import "./App.css";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a>
          <h1>Weather App</h1>
        </a>
      </header>
    </div>
  );
}

export default App;
